PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE DATABASE IF NOT EXISTS "gaming";
USE "gaming";
CREATE TABLE IF NOT EXISTS "Consoles" (
	"Id"	TEXT NOT NULL,
	"Name"	TEXT NOT NULL,
	"Manufacturer"	TEXT NOT NULL,
	"Year_of_Release"	INTEGER,
	"Sales"	REAL,
	"Type"	TEXT,
	"Number_of_Exclusives"	INTEGER,
	PRIMARY KEY("Id")
);
CREATE TABLE IF NOT EXISTS "VideoGames" (
	"Id"	INTEGER NOT NULL,
	"Name"	TEXT NOT NULL,
	"Platform"	TEXT,
	"Year_of_Release"	TEXT DEFAULT 'N/A',
	"Genre"	TEXT,
	"Publisher"	TEXT,
	"NA_Sales"	REAL DEFAULT 0,
	"EU_Sales"	REAL DEFAULT 0,
	"JP_Sales"	REAL DEFAULT 0,
	"Other_Sales"	REAL DEFAULT 0,
	"Global_Sales"	REAL DEFAULT 0,
	"Critic_Score"	REAL DEFAULT 0,
	"Critic_Count"	INTEGER DEFAULT 0,
	"User_Score"	REAL DEFAULT 0,
	"User_Count"	REAL DEFAULT 0,
	"Developer"	TEXT,
	"Rating"	TEXT,
	PRIMARY KEY("Id" AUTOINCREMENT)
);
CREATE TABLE Controllers (Id TEXT PRIMARY KEY NOT NULL, Brand TEXT NOT NULL, Series TEXT NOT NULL, Platforms TEXT, Feedback TEXT, "Number of buttons" INTEGER, Interface REAL, Weight INTEGER, Size TEXT, Rating REAL, "Link address");
CREATE TABLE Monitors (Id TEXT PRIMARY KEY NOT NULL, Brand TEXT NOT NULL, Series TEXT NOT NULL, Resolution TEXT, "Refresh rate" INTEGER, "Aspect ratio" TEXT, "Response time" REAL, Interface TEXT, Weight INTEGER, Size TEXT, Rating REAL, "Link address" TEXT);
CREATE TABLE Keyboards (Id TEXT PRIMARY KEY NOT NULL, Brand TEXT NOT NULL, Series TEXT NOT NULL, Type TEXT, "Switch type" TEXT, "Number of keys" INTEGER, Interface TEXT, Weight INTEGER, Size TEXT, Rating REAL, "Link address" TEXT);
CREATE TABLE IF NOT EXISTS "Mouses" (
	"Id" TEXT PRIMARY KEY NOT NULL,
	"Brand" TEXT NOT NULL, 
	"Series" TEXT NOT NULL, 
	"Resolution" TEXT, 
	"Design" TEXT, 
	"Number of buttons" INTEGER, 
	"Interface" TEXT, 
	"Weight" INTEGER, 
	"Size" TEXT, 
	"Rating" REAL, 
	"Link address" TEXT);
DELETE FROM sqlite_sequence;
COMMIT;
